import { Flex, Stack, Text, Container } from "@mantine/core";
import React from "react";

const Drawer = () => {
  return (
    <Stack bg="gray.3">
      <Container size="xs" bg="var(--mantine-color-blue-light)">
        Container with custom size
      </Container>
    </Stack>
  );
};

export default Drawer;
